rue)\n\nprint(\"Done in \", time.perf_counter() -t, \"secondes\")\nAdaptor.client.shutdown()\n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"months":[0,2,4,6,8,10]},"id":"1534","type":"MonthsTicker"},{"attributes":{"months":[0,4,8]},"id":"1521","type":"MonthsTicker"},{"attributes":{},"id":"1537","type":"YearsTicker"},{"attributes":{"base":60,"mantissas":[1,2,5,10,15,20,30],"max_interval":1800000.0,"min_interval":1000.0,"num_minor_ticks":0},"id":"1551","type":"AdaptiveTicker"},{"attributes":{"days":[1,8,15,22]},"id":"1531","type":"DaysTicker"},{"attributes":{},"id":"1076","type":"DataRange1d"},{"attributes":{"months":[0,6]},"id":"1536","type":"MonthsTicker"},{"attributes":{"coordinates":null,"formatter":{"id":"1435"},"group":null,"major_label_policy":{"id":"1436"},"ticker":{"id":"1089"},"visible":false},"id":"1088","type":"LinearAxis"},{"attributes":{"bottom":{"field":"bottom"},"fill_alpha":{"value":0.2},"fill_color":{"field":"color"},"hatch_alpha":{"value":0.2},"hatch_color":{"field":"color"},"left":{"field":"left"},"line_alpha":{"value":0.2},"line_width":{"value":2},"right":{"field":"right"},"top":{"field":"top"}},"id":"1033","type":"Quad"},{"attributes":{"days":[1,4,7,10,13,16,19,22,25,28]},"id":"1516","type":"DaysTicker"},{"attributes":{"axis":{"id":"1126"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1129","type":"Grid"},{"attributes":{"overlay":{"id":"1024"}},"id":"1021","type":"BoxZoomTool"},{"attributes":{"callback":null},"id":"1020","type":"TapTool"},{"attributes":{},"id":"1095","type":"ResetTool"},{"attributes":{"days":[1,15]},"id":"1532","type":"DaysTicker"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"1024","type":"BoxAnnotation"},{"attributes":{},"id":"1288",
